import { CartImg } from "../../locales/images/cart";
import { ButtonPhoto } from "../../style";

export const FoodPhotoButton = (type: string) => {
  return (
    <ButtonPhoto>{type === "cart" ? <CartImg /> : <CartImg />}</ButtonPhoto>
  );
};
